import React from "react";

const Tab = ({ name, imageSrc, i }) => {
  return (
    <div
      style={{
        background: "",
        width: "100%",
        height: "15vh",
        display: "flex",
        gap: "20px",
        justifyContent: "flex-start",
        flexDirection: "row",
        alignItems: "center",
        borderRadius: "20px",
        border: "1px solid black",
      }}
    >
      <p>1</p>
      <img
        src={imageSrc}
        style={{
          width: "50px",
          height: "50px",
          margin: "15px",
        }}
      />
      <h3>{name}</h3>
    </div>
  );
};

export default Tab;
